import React, { useEffect } from 'react';
import studentApi from 'api/studentApi';

import './App.css';

function App() {
	useEffect(() => {
		studentApi.getStudentById('sktwi1cgkkuif36f5').then((student) => console.log(student));
	}, []);
	return <div></div>;
}

export default App;
